import logo from './logo.svg';
import './App.css';
import Button from 'react-bootstrap/Button';


function App() {
  return (
    <div class="grid-container">
    <section class="logo">
    <img src={logo} className="App-logo" alt="logo" />
    </section>

    <section class="butt">
        <button type="button" class="btn btn-primary btn-lg" id="override1">Sign In </button>
        <button type="button" class="btn btn-primary btn-lg" id="override">Register</button>

    </section>

    <section class="stick">

    </section>

    <section class="mainn">
            <h1 class="maintxt">
                Forget about deciding where to eat, let us handle it.
            </h1>

    </section>

    <section class="bowl">
        <span class="dot"></span>
        <span class="dot"></span>



    </section>

    </div>
  );
}

export default App;

<img src={logo} className="App-logo" alt="logo" />
